  shape <- structure(list(AppId = structure(logical(0), tags = list(location = "uri", locationName = "appId", type = "string")), BackendEnvironmentName = structure(logical(0), tags = list(location = "uri", locationName = "backendEnvironmentName", type = "string")), JobId = structure(logical(0), tags = list(location = "uri", locationName = "jobId", type = "string")), Operation = structure(logical(0), tags = list(locationName = "operation", type = "string")), Status = structure(logical(0), tags = list(locationName = "status", type = "string"))), tags = list(type = "structure"))
